import React, {useContext} from 'react';
import Context from '../store/context';
import Table from 'react-bootstrap/Table';
import PricesTitle from '../Images/PricesTitle.png';
import "bootstrap/dist/css/bootstrap.css";
import UserContext from '../store/context';

function ShoppingCart () {
    const context = useContext(UserContext);
    return (
        <div>
            {/* <h1><img id="prices-title" src={PricesTitle} alt="Prices"></img></h1> */}
            <h1>{
              context.cart.length
            }</h1>
            <Table striped bordered hover variant="none" id="prices-table">
                <thead>
                    <tr>
                        <th>ID#</th>
                        <th>Item</th>
                        <th>Price</th>
                        <th>Remove</th>
                    </tr>
                    {
                      context.cart.map( (item) => {
                        return (
                          <tr>
                            <td>{item.id}</td>
                            <td>{item.name}</td>
                            <td>$3.00</td>
                            <td><button>remove</button></td>
                          </tr>
                        )
                      })
                    }
                    <tr>
                        <th>Total:</th>
                        <td></td>
                        <th>${context.cart.length * 3}.00</th>
                    </tr>

                    {/* <tr>
                        <td>1</td>
                        <td>Pre-Designed Sticker</td>
                        <td>Small: $4.00</td>
                    </tr>
                    <tr>
                        <td>2</td>
                        <td></td>
                        <td>Medium: $6.00</td>
                    </tr>
                    <tr>
                        <td>3</td>
                        <td></td>
                        <td>Large: $10.00</td>
                    </tr>
                    <tr>
                        <td>4</td>
                        <td>Custom Image Sticker</td>
                        <td>Small: $6.00</td>
                    </tr>
                    <tr>
                        <td>5</td>
                        <td></td>
                        <td>Medium: $8.00</td>
                    </tr>
                    <tr>
                        <td>6</td>
                        <td></td>
                        <td>Large: $13.00</td>
                    </tr> */}
                </thead>
            </Table>
        </div>
    );
}

export default ShoppingCart;
